The On Track Survey is conducted in April to mid-July of Victorian school leavers who completed Year 12 or equivalent in the previous year and who agreed to participate in the survey. 
The On Track survey seeks to: 
Offer a consistent and comprehensive approach to monitoring the transitions of school leavers; 
Report the information to schools, TAFE institutions and other education providers, organisations concerned with assisting young people, policy makers, parents and students; 
Provide detailed analysis of the transitions experienced by different groups of leavers; 
Enable education providers to use the findings to monitor and improve their programs; and 
Provide a referral service for school leavers who appear to be experiencing difficulties in the transition process.
On Track survey data is based on the number of students who responded to the 2020 On Track survey. This is a proportion of those who consented to participate in the On Track survey within the school.
Moreover, the information about the survey as well as the annual results (current and historical) are also available from DET website (https://www.education.vic.gov.au/about/research/Pages/ontrack.aspx), where the datasets are listed and available in the Data and reports &gt; Year 12 completers summary section.

